import React, { useState } from 'react';
import './Header.css';

function Header() {
    const [menuOpen, setMenuOpen] = useState(false);

    const toggleMenu = () => {
        setMenuOpen(!menuOpen);
    };

    return (
        <header className={`header ${menuOpen ? 'nav-active' : ''}`}>
            <div className="logo">FoodEx</div>
            <div className="menu-toggle" onClick={toggleMenu}>
                &#9776; {/* Hamburger icon */}
            </div>
            <nav>
                <a href="#">Home</a>
                <a href="#">Dish Categories</a>
                <a href="#">Shop</a>
                <a href="#">More</a>
                <button>Login</button>
            </nav>
        </header>
    );
}

export default Header;
